import React, { Component } from "react";
import logo from "../logo.png";
import Identicon from "identicon.js";

class Main extends Component {
  render() {
    return (
      <main className="box">
        <div className="box__column box__title">
          전력 거래를 위해 정보를 등록하세요
        </div>
        <div className="box__column">
          <form
            onSubmit={event => {
              event.preventDefault();
              const carNum = this.carInfo1.value;
              const name = this.carInfo2.value;
              const socI = this.carInfo3.value;
              const socR = this.carInfo4.value;

              this.props.setCar(carNum, name, socI, socR);
            }}
          >
            <input
              id="carInfo1"
              ref={input => {
                this.carInfo1 = input;
              }}
              type="text"
              className="form-control"
              placeholder="차 번호를 입력하세요"
              required
            />

            <input
              id="carInfo2"
              ref={input => {
                this.carInfo2 = input;
              }}
              type="text"
              className="form-control"
              placeholder="이름을 입력하세요"
              required
            />

            <input
              id="carInfo3"
              ref={input => {
                this.carInfo3 = input;
              }}
              type="text"
              className="form-control"
              placeholder="현재 전력 상태를 입력하세요"
              required
            />

            <input
              id="carInfo4"
              ref={input => {
                this.carInfo4 = input;
              }}
              type="text"
              className="form-control"
              placeholder="원하는 전력 상태를 입력하세요"
              required
            />

            <button type="submit" className="btn btn-primary btn-block">
              정보등록
            </button>
          </form>
        </div>
      </main>
    );
  }
}

export default Main;
